window.bookSummaryJSON = "<p>Delilah hates me. But I'm going to marry her anyway. </p> <p>Delilah is different. Quiet. Reserved. Smart. But she doesn't want anything to do with me. So, of course, I have to have her. She's got the sultry librarian look, full lips, all those curves; I can't get enough. I'll convince her to be mine. Just one night. I never fail. </p> <p>But I'm her new boss. And if anyone at the office found out about our one-night stand, we would both be ruined. So we'll keep it to one night of passion. Then we'll go our separate ways. That was the plan anyway. </p> <p>But now I can't let her go. Because she's carrying my babies. All three of them. And I won't let her do this alone. </p> <p>Contains mature themes.</p>"; 
